import './App.css';
import { Cart, Main } from './pages';
import { Route, Switch } from 'react-router-dom';

function App() {
  return (
    <div>

      <Switch>
        <Route path="/">
          <Main />
        </Route>
        <Route path="/cart">
          <Cart />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
